C.Fw=new H.a_(7,{key:C.jw,title:"The Art",date:"24 September 1945",beforeEntry:null,entry:"     The most widely talked of and thought of subject when men are segregated from women is the subject of sex. In this talking and thinking along theses line comes the problem of seduction and the morals of it all. \n\n     I am no strong believer in the morals connected with seduction and intercourse because I find my point of view changing frequently; changing with the environment, weather, society and presence and influence of women. On the whole I believe that sex should be treated naturally and in a manner similar to any desire; it should be indulged in in moderation and to such a degree that there are no harmful effects. Due to the nature of the thing intercourse can be anything from a great delight to grabby orgy, and the latter is to be avoided. Being away from the company of women is apt to heighten the importance of the act itself. It seems to me that the most important part to it is the love sympathy and the feeling of of having given great pleasure to the other, that goes with the act itself. \n\n     Therefore using the above assumption, the only way to gain any real pleasure from this is by seduction; this also elliminates whores, \"victory girls\" and all of the \"beastly pigs\" one usually picks up very late on those drunken evenings. \n\n     Naturally we must take under consideration, first the girls. For me this is an easy problem in a way, though it has led nearly constantly to my complete failure. I've got to enjoy and like the girl before I can do a thing. The rough and tough usual pick up I can't stand, so she is out. Pick a girl you would enjoy if you were just going to go dancing or take to a party. If you like her half the problem is solved. \n\n     Now the object is for her to like you. This should be done naturally as you would with anyone and no particular object in mind. You treat her politely and thoughtfully -- just relax and act natural. Either she'll like you or she won't so don't sweat over it. Then tak it easy; don't go rushing for the bunk as soon as she shows any signs of [warming?] up. You don't have to neck her th first night. You might make a gentle pass just to prove your a man but nothing forceful. \n\n     Take her out for a while until necking becomes a mater of course. Take her to nice places and have a good clean time. By this time you ought to be pretty interested in her in a friendly and physical way, but don't weaken. Now comes the time when careful plans must be made and charmingly executed. The main point is to find a place, quiet, comfortable, and above all where you are safe from interruption; also it must not be obvious A hotel room firs the bill on certain occasions but in general it is too obvious unless you can think up a suitable excuse. An apartment is good, your own or the girls if her family are out of the way and her girl friend taken care of. If the weather is warm enough, the beach is good. But above all the strategic location is essential and take a good bit of thought. Before arriving at your \"lovers lair\" a decoy should be presented or a red herring led across the trail such as going to a movie or a show anything which will end early enough to give you plenty of operating time and get her in the mood for a bit of loving. \n\n     When the players are in position the first move should be toward a comfortable spot. Then proceed along the usual lines for necking. Make sure you don't rush things but above all don't weaken but keep pushing things along. In general a guy is inclined to feel pretty satisfied and just let things go but you've got to keep moving along, never retreat and don't stop. Girls are human and have very strong desires; its up to you to arouse them and then keep going. One must be persistent. She may not actually want to, but she can be persuaded. \n\n     This sounds as though I've had a lot of experience with this wort of thing. Actually I've made a number of attempts but my batting average is low. We'll see how it is after this trip to the states! \n\n\n9 Oct 1945 \n\n     I've more or less clarified my ideas on the morals and ethics concerning sexual relations. For my particular case, I've decided that I'll take what I can get with the following exceptions, whores, prostitutes, and real pigs are out, they don't even count. Of the other girls, I will let the choice be mainly thiers, for though I'll be persistant as all Hell and do my share fully, I'll do nothing really nasty like getting her too drunk to realize it or too grabby. \n\n     My ideas on the subject for women are that it is really up to them, when they really feel it is right and something they want and when they think it will be good, why go ahead. For some girls I'm convinced they'd do much better and be better and truer wives if they had a little experience before marriage. Not that they should sleep with every man who comes along, wut when they find someone they like a lot and who likes them, then go ahead.",afterEntry:null,additionalContent:null},C.y,t.R)
C.Fn=new H.a_(7,{key:C.jx,title:"Dee Channey",date:"9 October 1945",beforeEntry:null,entry:"     Dee has the honor of being the first girl to be discussed in this log and the reason for it is that she interested me so and her problem has never really been presented to me before. It didn't take me more than a few minutes talking with her for me to decide that she was over sexed; it was very evident that she liked men very much and made no bones about it. From the discussion later with Mrs. Monroe, about her mother, I could see where it came from. \n\n     I was not much interested in her problem until I went out with her later on. We spent a lot of time discussing hers and my childhood and from this talk and her actions later I can see that she has had a difficult time. She seems to have matured quite a bit earlier than other girls and much earlier than the boys her age; consequently when everyone else was thinking about [dulle baskall?] and other normal activities she was feeling the stirrings of sex. She was undoubtedly pretty lonely at this time since there were few girls she could feel much in common with and few boys to which she could talk. She must have worked off a lot pof this excess energy and desire by being a very energetic [tomboy?]. \n\n     I doubt very much if sending her to Miss Walkers was a good idea. Such a monastery as that no doubt accentuated her frustrations more than ever. It would have been better to send her to a more lenient school where she could have more normal relations with boys. \n\n     As I saw her that one evening in San Diego she was very much over sexed and also rather pathetic. You could tell by the sensual way she danced and kissed that she was very frustrated and desirous. Yet she claims to be a virgin and I have no knowledge of her being otherwise. You could see how frustrated she was or rather how much of a struggle her self-denial was, by the way she pleaded with me while necking not to get her too aroused. Her virginity was due by her own admission not so much a matter of morals but rather she feared that too much experience would ruin her married life and would probably not be able to control herself. \n\n     I think that though she does have a point in some cases, she is wrong in her case. I would adviser her to go ahead and sleep, even live with someone if she wanted because I don't believe her self-denial will never settle for one man, no matter who and this frustration may even make her worse when the time comes. She should go ahead with some one she likes and who she enjoys; live with him and get used to herself under such circumstances. She ought to stick to one man at a time to avoid being too promiscuous. It might help and I'm sure it would do any harm. Her virginity won't last long anyway because I'm convinced and would lay two to one that I could make her given the proper set up within a week. And besides the longer she waits the worse she'll be when she does start. \n\n     Of course where she is pathetic and much to be ashamed is the way she does fight her desires; you can really see her struggle. She has been brough up \"right\", in the tradition that intercourse before marriage is to be frowned on. She tried to live up to herself and the reputation of her brother who was killed. She knows that in many cases she is being taken advantage of and that many are around just for \"what they can get\"/ Also she understands herself pretty well and knows how different she is from the other girls, and tries so hard to do as they do, but it is all futile. \n\n     She was surely an interesting character and I'm sorry I wasn't around for that week for more than just one reason. \n \n A letter \n \n Dear Dee, \n     Just to show you that I'm a gentleman of my word, if not always one of such honorable intentions, here is the letter I promised; and prompt too. Honestly, though, I would have written you anyway, if only to thank you for the very pleasant evening. It was, and I'm not kidding, one of the best times I can remember for a long time. The whole evening was wonderful, the cocktails, dinner, the dancing [and you do dance well, in more ways than one] and afterward. Please don't get me wrong; though at times I must admit my ideas were anything but gentlemanly, it was the fact that I enjoyed your company so much that I had such a good time. \n\n     We left bright and early Saturday morning despite my pleading that we stay for a few more days at least, and we are now on our long trip to Panama and Norfolk. I am looking forward to seeing the Canal Zone of which I have heard many tales; it is reputed to be quite a game spot; though we will not be there for more than a day or two. As for what will happen when we reach Norfolk, only God and Admiral King know that and they won't tell. I expect to get home for a thirty day leave sometime to rehabilitate and get used to the shore and after that no one knows. I wish you were going to be around the east sometime. \n\n     I just want to say again what a grand time it was and how I hated to leave. I really wish we could have had a couple of more evenings, though perhaps it is better that we didn't - who knows! I know we will meet again somewhere, sometime my crystal ball tells me so and I'd even bet on it. \n\n     Anyway write me now and then and though I am a lousy correspondent I will make the supreme sacrifice and drop you a line now and then of my doings [about?]. \n Lots of love etc",afterEntry:null,additionalContent:null},C.y,t.R)
C.Fe=new H.a_(7,{key:C.jz,title:"Possible Future Activities",date:"24 October 1945",beforeEntry:null,entry:"     The closer I get to the date of my discharge from the US Navy, more uncertain I am about what I want to do. I have several conflicting desires which make my choice rather difficult. I still have not fulfilled my wanderlust and desire for adventure, romance and experience and I feel that now is the time to get that cleaned out of my system. On the other hand I wouldn't mind doing a little more studying at college. And thirdly I'm not sure but what I could learn more and gain more experience by getting the kind of job I want to hold now and get started toward my business career. And there is also the desire to return to my prewar life around home, the family, Model Farm, the Cape, sailing, skiing etc. \n\n     In the way of adventure I would like to travel around a bit and see a few game spots, meet strange people, know different women and do different things. Though I've always been associated with the same type of people and for a while I would like to see some of the others. I could do it, with a little luck, in the Navy. I wouldn't mind going out again if I could hit some interesting places and have enough time there to learn and know the people. The Orient and Europe would be interesting if I were able to spend enough time ashore and if I could get some close contact with the people. The only unfortunate part to the navy way would be that I probably wouldn't have enough time to make really close contact with the people and most of the places would be pretty well ruined by the war. \n\n     I would also like to  take a year and just knock around the country as a civilian, where ever I wanted to go or choice would take me. I'd like to do odd jobs in different places, in cities, small towns. Alaska, perhaps Mexico and South America. Not jobs of much importance but small manual labor or unskilled jobs to make enough to live on and so that I could meet my fellows on common ground. I could start out through the Middle West, Chicago Illinois and work westward from there or I might even start in Montreal and work down to Chicago. I could take jobs such a waiters, soda [jerks?], anything that might be interesting. I could be a lot of interesting characters, male and female and gain a great deal of experience in kinds of work and life in the United States and surrounding territory. It like to try a few big industries just to see how they operate. I'd like to get some guy to do it with me so that I could keep from getting too fond at times and so there would be a a fellow sympathizer to enjoy the experience with. We could start out with and old car and a old suit of clothes and a couple of hundred dollars and just room. I wonder if I could take it. \n\n     Then there is the other desire, to go back to Yale and finish some of my undone work. I'd like to go back for about a year and take a few courses I missed, thermodynamics, another course in calculus, finished advanced organic and try to get a little background in nuclear chemistry or physics and perhaps a little electrical engineering. All of that would come in very handy in any chemical work I might run into in the future and they are subjects I feel I need and now lack considerably. Along with the desire for knowledge - and for me that is the best and possible the only way I would be able to force myself to absorb it - there is thought of a real peace time [?] life. I could have a car and travel around to the many girls colleges, lead a [? ?] life, be around familiar spots with old friends; there would be [Zate?] and [Elilue?] and perhaps above all the fact that the younger lads would look up to and respect me for my broader experiences and activities during the war. Actually I think it would be mainly for the studying that I would go back, and it would be very important for the work I would like to do in the future. \n\n     Along the same lines would be taking a fairly good job as a chemist in some chemical concern such as the chemical department of the OC. I have considered this fairly seriously if I can get they type of job I want. I want a job in the production end of chemicals or chemical products, a job which will utilize my knowledge of chemistry and engineering. I want a job which keeps moving, new processes, new problems and one in which I can have confidence in myself. It may be that I would learn more by getting the job and starting out on it right away than if I went back to school for a year. Also the possibility of my getting the kind of job I want will be much greater immediately after I get out than it will a from then. The idea of may does not interest me nearly as much as the kind of work and the interest I take in it. \n\n     I also know that no matter what I do I'm going to miss Model Farm and all that goes with it. Though I do want to get out from the family wing so to speak, I'm going to miss them and our life together a great, great deal. The skiing and sailing are going to be magnets with great pulling power toward bringing me back to the fold. When I start to think about getting married and raising a family I immediately connect it with Dalton and my bringing up. I hope that when the time comes I will be able to come back there to raise a large flock of new Cranes. I do not intend to dessert the fold entirely but only for a while; only for long enough to get something out of my system and to make me a little different than the others and keep me from being too conventional. \n\n     Upon thinking over the various schemes I would sum up and analyze them as follows: The first one stems from my desire to be different and to do things I've never done before. I want to see for myself what I can do and what I can't; I want to put myself in a class with everyone else and see how well I can do. I want to know a log more about human nature, I want to live with different women, do different work and know different men. In short I want experiences that won't be able to get around home and won't get after I'm settled down; experiences that many men have had, but that I have never had. It is something I want very much an probably need to get out of my system, but it is the least problematic of them all. I think I really should do it one way or another. As for the return to college, the studying end would be an excellent idea because I can already see the need for those courses, and I know that I do not have enough will power to study that stuff on my own. The part about the old college life, however is not such a good idea. I would then be living in the past and on old friendships; my experiences would dwindle to old stuff and I'm afraid I would be begin to develop into the perpetual \"rah-rah old grad\". As for the third, that would be the most Babbitt conventional thing I could do. That one act would tie me up quicker and stronger than anything else. If it were a job which moved me around a lot it wouldn't be too bad, but I'm afraid I would soon become the old business man. Also if my background proved weak, I would become quite frustrated due to the desire to learn it and the natural effort needed to get me to do it by myself. The last unfortunately is probably the most likely! \n\n     Right now I begin to see the truth in the saying that life is much too short.",afterEntry:null,additionalContent:null},C.y,t.R)
C.Fd=new H.a_(7,{key:C.jA,title:"Unions",date:"12 November 1945",beforeEntry:null,entry:"     I believe there should be unions and I think that is a view which has become fairly well accepted by all businessmen. The Labor class is one of the largest groups of individuals and it must be represented by some organization. However to a certain extent labor should support capital rather than fight it, since capital is its livelyhood. Unions on the whole, as they stand now are not fulfilling the job they were intended to perform, namely give a voice to the workers and give them the neccessary power with which to bargain for their rights and needs. \n\n     The scale has now swung the other way, now the unions are all powerfull and there is no way of controlling them. As things stand now management has no means with which to combat union demands, which seems to be nothing more than higher wages and less work. There is a limit to which these demands can go. So far the government has been able to do little about controlling union demands or their strikes. This is a bad situation. \n\n     Now that the unions have gained recognition by government and industry and have grown to be such powerful organizations that they can influence national as well as local elections it is time that they were watched closely. It is time that unions were put under a little government supervision similar to corporation laws. There books should be opened to the public to cut down on [graft?] and the use of funds for political activities. The election system for electing the powerful labor leaders should be overhauled and made much more democratic by bringing the elections to the public. At the present time the overage worker has little say about the policies of the union or who his leaders are. Dues and initiation fees should be kept as low as possible so that there will be no discrimination. And the unions must be able to control their members so that there will be no [ardent?] striking or large absenteeism. \n\n     Under proper circumstances unions could be a great help to management by largely taking over personal matters. A union representative could be present in the personnel office to help workers and also to punish those who are not up to standard. I have thought that it might be worth while to have the unions own a large share of the corporation stock and have a member on the board of directors. this man would be elected by the union an would be able to present their interests in making executive decisions; he would also be able to present managements problems to the union. Since it is to labors advantage to keep business running at a profit and to managements advantage to have a happy and efficient labor organization; the two should be able to work hand in hand. \n\n     I am very interested to see the stand Higgins has taken with his labor troubles. I have often thought that if I were running a large plant and labors demands became too excessive I would call in the union officials and tell them I was through and if they were interested they could buy me out for a reasonable price. I would then say that for a good salary I'd work for them an they could run the god-damn thing and lose all the money they wanted.",afterEntry:null,additionalContent:null},C.y,t.R)
C.Fk=new H.a_(7,{key:C.jB,title:"My Next Duty",date:"18 November 1945",beforeEntry:null,entry:"     Assuming that I have a very good chance of getting about any duty I want, I am now faced with the problem of what I want. I have cut them all down to two choices, an instructor on NROTC at Yale or sea duty around China on a cam preferably. \n\n     For soft shore duty the former would be tops. It would be almost the same as going back to college. I would get an appartment, own a car, visit Zete and [Elilue?] regularly and in most ways have the life of an undergraduate, with certain advantages of being a member of the faculty. With so many of my old friends back I would would have no trouble finding drinking companions and I would be able to attend all the gamer festivities with a certain amount of prestige pertaining to my position as an instructor. I ought to be able to audit a few courses in ,y spare time and perhaps get some of the courses that I feel I missed. I would be able to fill my students full of a lot of salty bunk about how I won the war of Formosa etc. On the whole it would be perfect duty, just the perfect combination of gamerness with the proper intellectual background, a place close to home and plenty of girls I know close at hand, and a proper spot to operate from and above all not too much work to do. \n\n     THen there is the other choice; sea duty with the Asiatic Fleet. Number one reason for that seemingly peculiar idea is my old wander-lust and insatiable curiosity. I would really like to get out to China and see what its like, how the people live and above all get in on a little adventure. I would also like very much to have a job on a newer, better organized ship, in the engineering dept and see if I could handle the job. Perhaps a little regulation peace-time navy would be a good thing for me. I still have that slightly guilty feeling about not having had it very rough during the war and I should make up for it now. I'd like to see China, Japan, and some of these other romantic spots that one used to hear so much about. \n\n     Now my biggest fear in applying for this duty is that I won't see the places I want to, or if I do, I won't get the chance to run around and see the people, etc. the way I'd like to. I really have no desire to see [Alithi?], [Euewetor?] or some of those joints ever again. I would like to see civilization and new and different civilizations at that. I want to see women; plenty of women, who are different, I want to see odd customs and places. But mainly I would like to see a little of this excitement that is going on out there and take part in some of it. I want excitement and knew experiences. I'm a little worried that if I do get out there I won't find the particular things, and I know I'll kick myself for a damn fool for requesting it as soon as I do get out. \n\n     What it really comes down to is, what do I want; a gay college life, with all its weird activities under nearly ideal conditions, a life I was never able to have while at college due to the war; or a life at sea as a man and officer with lots of excitement (I hope) and not all the gay social activities which I love so well. \n\n     I'm still undecided.",afterEntry:null,additionalContent:null},C.y,t.R)
C.Fp=new H.a_(7,{key:C.jC,title:"Ending War",date:"18 November 1945",beforeEntry:null,entry:"     With the advent of the atomic age as ushered in by the atomic bomb, it seems to me that it is about time that we the people of the world stop this silly fighting and spent our time on other things. The time has come when there are but two possibilities either we end ware or it will end us; that I think we can agree on. Now comes the problem of how can war be ended. \n\n     I think we should tackle this problem by looking at nations as individual humans, with personalities consisting of the overage personality of their populace and leaders. Like individuals each country is different and each has its weaknesses and desires; each has the failings of the human race in a larger or smaller degree. Whereas humans fight merely with there fists or pistols, countries use armies and navies and now atomic weapons. It is possible for people to live together in a community without constant fist fights and shootings; therefore it seems to me that it is possible for nations to live together in peace, not in constant harmony perhaps, but at least in peace. Now with people this can only be done by discipline and justice. First there must be a judge or court of some kind to make the laws and decide in some legal way the quarrels and disputes which are bound to arise; second there must be some law enforcement body set up to maintain discipline and back up the rules od the court. That is is how people are governed. This organization can be set up in two ways, either by having one man seize power and enforce his laws or it can be done by democratic methods. As it stands today we the United States are the only country equipt to seize control of the world by force. It would probably be the best thing for the world if we went to war immediately and by the use of the atomic bomb took complete control of all countries in the world. And then gradually get people into the frame of mind for a freely United World and eventually give all parts certain sovereign rights much the way the states have rights in this country. Naturally this country due to public opinion could never undertake such as task in such a bloody manner. \n\n     The only other method is be nations getting together and each one giving up some of its sovereignty to a world organization. This offers a great many practical problems since no nation likes to give up its sovereignty of its own free will. I agree with Cord Meyer that the U.N.O is not strong enough to be effective; it needs more force behind it and more trust from its members. I believe that we must use our knowledge of the atomic bomb as a diplomatic club to force the other nations into line. But first to give our share of our own national sovereignty to the U.N.O. We must lead the way. We must be the first to start forcing and [?] the other countries to support a string central world government.",afterEntry:null,additionalContent:"[NEWSPAPER CLIPPING]"},C.y,t.R)
C.Fg=new H.a_(7,{key:C.k2,title:"Letter to Pop",date:"8 February 1946",beforeEntry:null,entry:"Dear Pop, \n\n     I just got your letter telling me about struggling to get a ride to Tremblant; despite the trials I wish I were going with you. I hope you have a fine time and the snow is good. \n\n     Yesterday I took the trial run of the Bausell (DD 845) down to Boston and it was a grand trip. We made 35 - 36 knots all the way with no strain at all. I think they are wonderful ships and only wish mine were all ready to go too. The engineering plant is a honey; it looks very complicated at first with steam lines running all over the place but once you catch on it really quite simple. I'm not half so scared of it now as I was before. The ship rides a little rough when she is making that speed and I may say that some of the boys didn't enjoy the trip as much as I; I found quite a few looking for mermaids and it was a wet day for that. \n\n     I enquired from the SupShips about your going down with us on our trip and he said it would be all right. I have to make out some kind of a letter or something but it will be OK for you to come. We will go down to Boston on the 5th, the same day we are commissioned. We leave here at 7 in the morning, get there about noon and are commissioned at 3 o'clock. I'll get the invitations for you and Mom and Pam if she can come. \n\n     A few more of my men have arrived and from the looks of it none of them will have any experience on the type of a ship; how ever I guess they will be able to get on t o the plant before we go into commission. One of my chiefs arrived and the very first night I had to rescue him from the local jail, but he seems to have squared a way now; at least I hope so. The skipper is due to arrive tomorrow and from all reports he is a pretty good man. He has just come from command of another can [??] which is a good sign at least, his name is Cmdr B.A,Smith and he was on the Murphy. The exec is also reported to be a square gut though I don't know first hand. Anyway it sounds good and all I can do is hope. There are still only two of us here but I expect there will be a few more with the skipper. I hope he won't think that I haven't done enough but I have been pretty handicapped by lack of personnel and not knowing just what he wanted done. \n\n     Write me about the snow conditions and how the flying mile looks to you. Give my best to the McCallum's. Have fun. \n\n               Love \n                Fred",afterEntry:null,additionalContent:"[ENVELOPE]"},C.y,t.R)
C.ET=new H.a_(7,{key:C.jD,title:"Reflections On Leaving Ozbourn",date:"4 June 1946",beforeEntry:null,entry:"     The \"Dirty O\" as it was known, despite the connotations of the name, was a fine ship. In fact it was the finest I have ever seen. That ship could out fight, out shoot, out drink, and out love any ship in the navy; it had the spirit that couldn't loose I have always thought that it was in a way too bad that she never had a war to fight, because she would be a awfully efficient fighting machine. That ship would challenge anyone at anything and beat them and they loved a good fight; if there was no one else to fight with they would fight with themselves. The crew was the finest I have ever seen and the best I ever hope to meet. \n\n     In many, many ways I was genuinely sorry to leave the \"Oz\" and awfully glad I made one trip on her. For one thing it was an honor to work with a bunch of men like my crew of engineers. On the whole they came aboard ship in Boston as green as any bunch I have ever seen; most of them had never been aboard ship before and even the petty officers most had never been on cams particularly this type before. It was one of the greatest feelings in the world to watch that bunch come together and form an efficient team; slowly to be sure but in two months time they were as efficient as any group I have ever seen \n\n     By far the greatest pleasure of all was knowing within myself that I had done a good job. I took the job with considerable misgiving. I had been Chief on the Tever for seven months it is true but I never did what I wanted with that ship and I never satisfied myself that I ran the engineering department as well as it could have been run; in short I was not satisfied with the job I had done. My job on the \"O\" was more of a challenge than anything else. It was a new ship, a power plant I was completely unfamiliar with and a damn big job. I had to organize, train, and run a brand new group of men; teach them about a plant about which I knew absolutely nothing. I took the job to prove to myself that I could do it, knowing that any faults in the set up, organization, or training would be mine. I wanted to prove to myself that I could do it. \n\n     In my estimation, and that is the one that really counts in this case, I did the job damn well. We ran the plant with very little difficulty and very few casualties and they were minor. Compared to some of the we were pretty outstanding. I will say that my lucky start was awfully good to me in many ways. First I had a darn good ship, given to me in fine shape. I wouldn't trade a Bath build ship for any ship in the Navy. The ship was clean, designed well and above all the machinery was in top operating condition when I took her. I was given the grace of God and BuPers and a darn fine crew. The experienced men aI had were excellent; they learned fast and were able to pass their knowledge along to the green hands, I was also blessed with two fine assistants; Sullivan with experience as Chief Engineer on two ships was indispensable. He was hard working, likable, easy to get along with and above all a darn fine engineer. Gus was also a good engineer and industrious and easy to work with. Among the chiefs Mess was by far outstanding and by far the best chief I have ever had the pleasure of knowing. He was above all conscientious and a leader of men and had the ability to train the men under him. \n\n     I also had the finest reward of all; knowing that the men liked and respected me. On the Trever I was liked but I'm afraid not respected much. But on the Ozbourn I got both. I really believe that Laughlin was telling the truth that night when he told me that the men respected me more than any they had ever worked for. For one thing I never had to put one man on report or ever have to cuss about a job being done twice. It was the nicest feeling in the world to give an order and see it carried out with no fuss or strain. And the department was good. I took great pride in my engine rooms and fire rooms and I think that the men did too. They were always clean and in good repair and more than that they always showed signs of work being done and improvement going on. Strangely enough I think that the captain thought it was a pretty good job too. \n\n     On looking back I will say that I never worked harder in my life than I did on the 'O'. And I doubt if I will ever get more satisfaction than I did from the job. It was a job I loved with a bunch of men who couldn't be better and it was done to my satisfaction. I am forever greatful that I got that job and was thus able to prove to myself what I could do. I believe I learned more about men, machines, and engineering in these few months than at any other time in my life. I only hope that I will be able again to do such a job and again get such satisfaction. I liked the ship and I liked the job and the men liked me.",afterEntry:null,additionalContent:null},C.y,t.R)
C.Fb=new H.a_(7,{key:C.jE,title:"Letter To Barbara Crane",date:"14 February 1945",beforeEntry:"(after return to states)",entry:"     Just a note to say a few things I didn't have the chance to say last night, atmosphere and lack of time preventing. First I want to say I had a most enjoyable evening; much more pleasant than I anticipates, what with tension, uncertainty - mostly mine only - and possible strained circumstatnce. On the whole it was fun. Now looking back on thw whole thing I really don't feel as abdly as I thought I would, as a matter of fact I felt much worse about it last night thinking about what might have happened. Now that we have it all figured out I feel much better, I like knowing how I stand, the score and situation; uncertainty disturbs me. \n\n     My new course is clear, I have just checked over my old \"wolf gear\", fangs, roving eye, etc and am ready to go again - not that they've been stowed away too long. \n\n     Now as too the future; I do hope you won't mind my writing you, I feel that you really know me pretty well and I need someone to whom to write my gripes, groans, philosophies. It really is a great help to unload these things in writing and you make such a pleasant listener. Besides, you are a cousin, you know! \n\n     Well it was fun and worth every minute of it. My only regret is that this damn war prevented my having more time to see you; our compartment was wonderful but woefully small. However, that is now over - that compartment shut. Now enters the platonic chapter, relationship as it was meant to be, cousins. \n\n     I went into this affair with my head up and eyes open. My original idea was certainly anything but serious; somewhere along the line I got sort of involved but now it is disentangled and life returns to a more familiar pattern. I feel no jealousy; I knew it would end like this sometime but I had hoped at a later date. But who am I to direct time and tides. \n\n     Your cousin and a damn good loser",afterEntry:null,additionalContent:null},C.y,t.R)
C.EQ=new H.a_(7,{key:C.jF,title:"After College, What?",date:"July 1946",beforeEntry:null,entry:"     The time has come for me to start considering the possibilities for a job when leaving Yale next spring. Now is a very good time to write upon my thoughts on jobs an occupations. If I can put my ideas down on paper concretely I will be much better off when I go around being interviewed this next year. \n\n     As I look at the subject now, I can see a definite ignorance about the types of jobs I am qualified for and are open to me. I may find too that after the comming years work I may not be so anxious to get a job in chemistry at all. As things stand now I'm quite sure I would prefer a job in some fairly large chemical concern or industry; plastics, petroleum, basic chemicals, dye, and numerous others. I think that I would prefer the organic field. I also have developed a great interest in engineering and plant operation during my sojourn in the navy which I would also like to include in my comming job. THen too there is the ever-present thrill attached to new development and research and that I would like to find in my work. To sum up; what I want is a job in organic chemistry which will require knowledge of engineering and which is continually advancing. \n\n     Now that we have this vague outline of an occupation there are many gaps that must be filled in. What kind of duties do I expect to preform? I naturally don't expect to start off in job which has a great deal of responsibility attached tey I do want some. I don't want to be just an auto-man who does the same thing over and over. In other words being a laboratory technician does not appeal to me, I want a job which is partially administrative. \n\n     I think the job which would come nearest meeting my requirements is a job as assistant plant, department or some unit manager in control of some chemical process; preferably in a development plant. I think at the present I would be better as a production man, or liaison man between research and development. A man who would need the background of a chemist and the practical experience of an engineer. The job I really want is not onw which I can expect jto get upon leaving college yet it is something I would like to strive for. \n\n     Actually I cannot tell at this time exactly what kind of job I can get or how I will like it but I do think that it will be for the best if I spend a considerable amount of time next year interviewing and talking to chemists in industry and there by getting a better idea od the possibilities. I once felt that the last thing I wanted in the navy was a job in engineering, perhaps my ideas on research and jobs will change also once I get into it. Only time will tell the truth. \n\n     As for Crane & Co; yes, I do intend to return at some future date, probably with in ten years. Mainly I will do this because I like Dalton and I would like to raise my family here. I also feel a certain amount of obligation and responsibility to the mills and once I have proved what I can do else where, I will return.",afterEntry:null,additionalContent:null},C.y,t.R)
