C.F6=new H.a_(7,{key:C.jI,title:"Dalton",date:"July 1946",beforeEntry:null,entry:"     To me there is no place on earth that I would rather spend most of my life than Dalton. I suppose it is only natural that I should feel this way since it is home to me but I do think I feel more strongly about it than most people. Why this is so is harder to explain than you might suppose. There are many obvious reasons of course and a few that aren't so apparent. Dalton is certainly a beautiful town, nestled in the Berkshires, with grand old elms and maples in abundance, nice comfortable houses, a typical New England town. There is a great feeling of space for no one is crowded; one always had the feeling that there is plenty of room. And above all nature is always so predominant. One never has to go more than a few hundred to find himself perfectly alone in the heart of nature; woods, fields, and hills [surround?] the town. Beautiful and roomy surrounding always have an effect on me akin to religion. Somehow I feel better, act better and am better when in this sort of environment. I love farms and working in soil, watching things grow, seeing cattle and horses grazing. It is all here. Skiing and skating are excellent in the winter and nearly all the summer sports are available. In short Dalton is grand for the outdoor man. \n\n     One of the best things of all about our community is the people who make it up. I have never seen a nicer bunch; not that they are terribly exciting or interesting but it is there way of life. There is none of the fast society set with its resulting divorces, intrigues, too much drinking, or too much loving. The older group and the young set believe in the old fashioned ideals of marriage and I'm sure nearly all practice it. To one the atmosphere is so much healthier here than in most of the places I have visited. Particularly for the teenagers it is better; for they all have other interests as well as girls & liquor. But people aren't stuffy here; they enjoy life to my way of thinking far more than most people. No group could be more hospitable or friendly or for that matter more tolerant. This is where I want to bring up my children. Also Dalton is a tradition with me, for six generations the Cranes lived here and now they have become an integral part of the town. Dalton is dependant on the Cranes and they upon Dalton. It is quite a challenge for me to live up to the reputation and respect which my forbearers have accrued and too live up to the responsibility to which I will fall heir. \n\n     With all this one might ask why do I wish to leave Dalton and seek work elsewhere. It is quite simple; I hope to work someplace people will not care whether I am Crane or Jone nor where my every move will be watched. I want to move a way for a while to gain experience and to an extent freedom from my obligations here but always with the idea of some day returning. When I have established a family and my own confidence and reputation I will return. ",afterEntry:null,additionalContent:null},C.y,t.R)
C.F5=new H.a_(7,{key:C.jH,title:"Something New in Sex",date:"November 1946",beforeEntry:null,entry:"     Due to a few new experiences in sex and thinking I have arrived a quite a few number of new conclustions; not all of them to different from ones I had previously held, but perhaps a few new connotations, new only to myself. These ideas pertain mainly to intimate relations with the opposite sex, broadly speaking, and the structure of women. \n\n     Having always had a rather idylic conception of the relation I might have witha woman whom I liked an yet was sleeping with, I have come to the possibility that it may not be what I've always thought it might be. Unfortunately it seems to be impossible to realize the perfectly 'platonic', unencumbered relations with a female you are sleeping with. It seems that either it becomes progressively an anticlimaxtic or it leads to love. One cannot be in such close contact with another person and maintain a perfectly rational equilibrium; it cannot remain static. \n\n     All my recent experiences have been based on Janet White and I think she is a girl worth of discussion. Of course my first reaction to her was at Pam's party in Dalton where she excelled by being the gamest girl there. Naturally when Lucy began to show signs of drifting away, I turned toward the nearest girl who was prospectively game, so I turned toward Jan, whom I really didn't know at all and yet was sure she would be perfect for rebuilding my ego. The first time I kissed her or necked with her which was a consciderable time after I'd frist taken her out, only went to bear out my original idea that she was pretty game and would unquestioningly be good for me at the time. That was the time when she and I recognized the [?]. It was merely an excuse for having some girl be nice to me inorder to build up my own ego. \n\n     Anyway time went on and I was at college and I thought that Hanet would be a good girl to keep around because I really enjoyed her company and I was able to neck successfully with her to satisfy a certain desire; plus the ... ",afterEntry:"** The following 17 pages have been torn out **",additionalContent:null},C.y,t.R)
