C.F0=new H.a_(7,{key:C.jS,title:"Difficulties Faced in Changing Standards & Morals",date:"21 November 1948",beforeEntry:null,entry:'     Strangely enough prior to the war, during it, and even the period directly following, I was pretty well adjusted to myself, and the morals and customs surrounding me. The adjustment or balance was very probably due to my naivatee and inexperience. The problem I am in particularly discussing is sex morals. Up until I met Jan White my experience with the opposite sex was pretty limited despite my [kiss?] talk and exaggerated claims. Until then I had always thought, as I was taught to believe, the "nice girls" were somewhat different to men and that the girls one would consider marrying were of course virgins. ThoughI had played around, made my attempts and had a few successes with girls of rather shady character and heard of and had some slight success with a few supposedly "nice girls" I still instinctively clung to the Victorian idea that girls you marry must be "untouched". Perhaps this is somewhat of an exaggeration perhaps it would be better to say that while one side of me was perfectly conscious of reality my inborn moris would not accept it. I was well adjusted because this latent conflict had never been brought to a head. \n\n     Early in the winter of 1947 when I began finding myself falling in love with Janet this conflict began to be felt and has bothered me increasingly ever since. IT was of course of of the major reasons for breaking engagement to her in March and the ensuing bitterness ever since. I am afraid that in many respects I was hypocritical in my lectures to her, for often enough I said that I expected no more from her in the way of sex morals than I I myself, yet in the end I could not live up to it. I agreed that women have the same basic desired as men and that our social standards were false and unfair. I tried to discriminate between a right or moral sexual relation and immoral one I managed to think up many mental dodges but none of them really impressed my subconscious principles. To this day, though, I will maintain that it was not the sexual relationship between she and I that caused its undoing but the relationships she had with men prior to me. \n\n     Now this problem is again presented in the form of Des Cognets; she is also a girl with a past and even more experience than Jan. I have a great respect for Betty in nearly all ways that I have encountered so far. She is intellegent, rational, curious and analytical. Her mental processed are much more akin to mine than Jan\'s and I can understand and respecter her more. Though I have not pressed her too deeply one her past, from what little I know I respect her more for it that I ever did Jan. But were I to find myself falling in love with her I would again be very troubled with the same old problem and again I would find that I lost faith in her because of it. \n\n     Why is this? By logic and biology I can argue all night why women are entitled to as much freedom as men and why are moral standards are a farce and delusion. I cannot answer fully the question, why should someone else having had her make her less for you? It all seems to point directly to early instillment of a standard which I can\'t shake plus a very prominent and unshakable male pride. Being a mildly egotistical extrovert, I like to feel that I\'m just a little bit better than some other guy and don\'t wish to share all with him. And I think that possibly the slight frustration with sex in my earlier days adn to a certain extent still, I am very sensitive when it comes to prowess with girls. I hate to admit it but I have a very strong tendency toward jealousy and this also seems to support my pride. Granting all this and more; what is to be done about it. The number of virgins in the world of the appriate age and qualifications is rapidly diminishing and the ones that I know had had find at all appealing are nearly extinct. I must either find on of these rare creatures or change my standards. A difficult and gloomy choice!',afterEntry:null,additionalContent:null},C.y,t.R)
C.F9=new H.a_(7,{key:C.jL,title:"Growing Philosophy on Life",date:"17 January 1949",beforeEntry:null,entry:'     "This above all, unto [thine?] ownself be true." \nI suppose that that one line states better than all that follows a belief in life which I have always had. Up until recently it has always been a somewhat nebulous belief and not too clearly understood; understood so poorly by be that its meaning and connotations in many cases escaped me. Never before had I understood the individualistic and egotistical implications of that quote. Previously I had always emphasized the importance of the word true, feeling that it carried the weight and moral philosophy in that quote; but now I find that the truth is nothing without the essential term "ownself"! \n\n     "Because there is no God \u8212", to use another quote (Maxwell Anderson), therefore I have nothing else to believe in but myself. Since I cannot find strength nor courage from an outside source, I must find it from with in, and I have nothing to draw on but myself. Though I have often thought that it would be a great aid many times to have a faith and trust upon which one could lean in times of weakness; I have never found one upon which I could really lean and get any real help. I have never found religion to be of any use to me because I do not have the faith and nothing in it has yet convinced me enough so that I can put any faith it. People, family, etc can serve as guides and in some cases inspiration but yet the strength must come from me alone and not second hand from another. Thus I have no faith in anything but myself and since one needs a strong faith, I must have a strong one in myself. \n\n     The first quote now becomes obvious in its connotations. In order for this faith to be strong one must be true. Once you have realized what it is to be untrue to yourself and therefore shattering the only faith one has there can be no question but that you must be true. It is impossible to try to hide the truth from yourself; you can try all kinds of devices and tricks, rationalization and escapism but you cannot hide it, and your faith is lessened in each attempt. One must be his own best critic and the only one of importance. Since tru happiness is purely the feelings of an individual; it can only be derived from your appraisal of your own actions or thoughts and not from others appraisal of you. \n\n     The best example of the ideal carried I\'m sure much beyond the power od mortal man is Howard Roork in "Fountainhead". I cannot begin to follow his footsteps but he does set up certain goals which I would like to strive for. \n\n     The basic problem comes in understanding what you want and what your motives and desires are, then live up to your own standards which you have set to the best of your ability, Then do as you know you should do (or must) and be damned to what others think of you. The most important thing is being and individual, yourself, and not a second-hander, a member of a herd.',afterEntry:null,additionalContent:null},C.y,t.R)
C.EP=new H.a_(7,{key:C.jO,title:"To J.S.K",date:"13 June 1950",beforeEntry:null,entry:"     Miss Joyce - It was as usual most pleasant to see you this weekend; I really mean it when I say I had a delightful time and loved being with you - despite your ill humor. Actually I have nothing to complain about since you were very nice to me and gave me a very good time. Strange as it may seem to you, I always have fun with you and it is always a pleasure to see you. I'll admit sometimes more so than others, but none theless always nice for me. \n\n     I am only sorry that you are in a bit of a gloom right now. (This is about to be a long winded letter, I've had a few martinis, but bear with me). I'm sure you are familiar with that common beat the \"make ego\", I must say I am by no means lacking it yet I'm sure that you must see that my present position is perhaps no well suited to building it or supporting it. This is all too true yet I have found ways of compensating it. If I can feel that I am doing something to help you or make you a better or happier person my little ego can be stilled, but it is dependant on that. Thus you can see why your attitude and feelings are so important to me. All I really ask is that I can help you a little in any way. \n\n     You say that you are dissatisfied with yourself etc, and that no one can help you but yourself; this is mainly true, but there are such things as a helping hand & a crutch. ANd these I am only to willing to offer to the best of my ability. Just remember, Miss Joyce, that I think very highly of you and when things look glum just think that I am honestly pay you the highest compliment I can offer \"merry me\". I hate to see anyone I think that much of feel badly about themselves, I might be inclined to lose faith in my own judgement. And kind Joycie, when you need a crutch to push you into doing something you should, just think of how much it will please me to have you do, and how much it would mean to me to know that I had helped you do something. \n\n     You say I'm a fool to be in love with you but I'm not. I'm getting much more out of it that you, because you are giving me a reason for doing things and a person to share enjoyment with. Even thought our motive are slightly different it would be a great help for you to try to get the same feeling across to you. I'm only sorry I'm not to right one for you so that it would be easier to do; but I shall try to make the best of the situation. I used this suggestion because you are a kind person and it is easy for you to be affectionate to others and thus try to show how much affection you can give me by doing those things you think you should. Try to make that affection a bit more than just a temporary thing. \n\n     And now for another subject, the 4th; I realize that it is a slim chance but if you should get Monday of or could take it, you would be most welcome here. You know there will be no interference from the wedding and that all would be delighted to see you. There is no possible chance of my asking anyone else for that weekend so feel free to announce it all at the last minute if you can come. Washington may be awfully hot at that time and Dalton rather pleasant so do try!",afterEntry:null,additionalContent:null},C.y,t.R)
C.Fz=new H.a_(7,{key:C.jP,title:"To JSK ",date:"1 December 1950",beforeEntry:null,entry:"     I suppose I am angry with you because you have caused the fall of another of my castles and so I must speak my piece in order to salvage at least some respect in my judgement. \n\n     WHen I first went tumbling into your lap you were an almost perfect answer to my prayer, not perfect because you wouldn't tumble back; but nonetheless as I have explained many times you did well enough and kept me very contented. Your affection, discipline, and appreciation of my sex appeal did a lot to restore my ego an self confidence. Because you did so much for me I have casually, naturally turned to you in time of need. This time I looked and knew you wouldn't be there. \n\n     Last night I sat down to write you a letter because I was having a moment of indecision and wanted to have someone to discuss it with. It was about the national crisis and what my feelings and actions should be. I started the letter to you - naturally turning to the person I felt closest too - and the letter went to Pam. \n\n     You see Joice in a time of crisis like that, you turn to someone for strength and guidance and it is only a person very close to whom you can turn. Sex and momentary affection don't pay off at such a time. YOu say that what I was asking for you couldn't give, love; but I say that's not the whole story. Love is wonderful but its a couple of the things that make it up that I wanted and could find in a person I'm not in love with. \n\n     Before one can show that much of oneself to anyother you must be sure of two things, true affection and an honest attempt to understand. YOur affection has always been momentary and I have never seen you display what I term true affection. A caress, a [conversational?] or [expanded?] [?], a note of respect, a [tobern?] of appreciation, all are the outward signs of affection. \n\n     You pride yourself on being affectionate and every one of those outward manners you have to high degree - but whats under it? It's not the outward signs that are affection, its the motivating force and what is yours? Why do your outward gestures fail over a distance or over a period of time. Why the lack of a feeling of responsibility? - No motivation, no affection,. Analyze it yourself and see. From an outward sense your perfect and only so can you get away with so much lack of effort. This will work in most cases but you for anyone in love with you or for any man considering you as a wife. \n\n     The other point, an honest attempt to understand me, is also pertinent. I know that it is really impossible to understand another, but the attempt is most important. Here again you show all the outward signs of interest and are [entreated?] in all the surface things. But what about underneath. A hundred times I've hoped you'd ask me what ticked under my skin and a hundred times I've tried to give all of me but no result, no interest. You can't give it and so you won't accept it. Janet was like that only at least she tried and she could accept it. \n\n     I don't know why I tell you this, maybe others have told you - maybe they haven't but some one should. Maybe thats why I could say to myself though I'm very in love I'll never marry you. So now Miss J you can have what you've said you wanted, sex and no responsibilities.  ",afterEntry:null,additionalContent:null},C.y,t.R)
C.Fl=new H.a_(7,{key:C.jM,title:"The Navy and Me",date:"2 January 1951",beforeEntry:null,entry:"     Although for the moment the international situation is not as bad as it first appeared it is still extremely bleak. Russia's objective is all too apparent; the destruction of the only obstacle in her path to world domination, the U.S.A. She apparently does not want an open fight if it can be avoided, but it is obvious that she is not scared of us and will not go too dar to avoid it. We evidently have a few months breathing spell and if we arm sufficiently we may have more. But arm we must and to the full extent of our resources. We have gone much too slowly and the worst comment on our present state of instability is that I have any decision to make. I and all like me should have been called or told that we would be called long ago. We should have mobilized immediately when the Reds first stepped across the Manchurian boarder. \n\n     Feeling as strongly as I do that we should be filly mobilized at the moment, leaves me with a very strong moral pressure to go. Also looking at it slightly longer range view, I see no way in which some kind of struggle can be avoided for long. There is room for only one of us on this earth and either we oe they will dominate. From every one of Russia's actions we can see that from her point of view she must remove us and to prevent it we must be strong. The struggle must come within the next two years and very probably much sooner - a matter of months. This leaves me feeling that my existance as present is really quite useless. Seeing this struggle coming I should be preparing myself to do all I can to prepare myself for it. Instead of making paper I should be practicing how to be a better officer. \n\n     Then there is the feeling of the futility of working as if nothing were going to happen. What is the use of being a better paper-maker when what is needed is a better naval officer. It becomes very frustrating to plan and work toward various goals only to know that you cannot even see them well on their way and worse to see the importance of those goals vanish in a war. \n\n     To get to a more practical side, what is a matter of a few months anyway. If I were married those few months might be very important but I'm not. The few months of my present life left to me are not worth it, if I can be of service elsewhere. And if by going in now I can take more active and successful part in the approaching war, the sacrifice was well worth it.",afterEntry:null,additionalContent:null},C.y,t.R)
C.Fv=new H.a_(7,{key:C.jN,title:"The Need For Guts",date:"January 1951",beforeEntry:null,entry:"     It is easy to see that my praise and flattery were much too premature and that without further ado you have sunk to your old self again. I must admit that my flattery was spoken by way of encouragement for a good beginning but without much faith in in its continuance and I see my lack of confidence is justified. You certainly show your true colors - a bit of ardent effort, discouragement and then complacence - right back where you started. \n\n     Joycie it is easy to see that you have no understanding of the word perseverance or the theory that a certain amount of continuous effort is the only way of accomplishing anything. This lack of perseverance runs through your whole character and to my way of thinking accounts for ninethenths of its short comings. Start with athletics, tennis skiing or golf - your lack of coordination never defeated you but merely the complete failure to try and try until you have beaten it and your own self (that tendance to quit when discouraged). This lack of coordination is merely an alibi to sooth your ego and protect your self respect. In every case where it is essentially a lack of true effort you always manufacture some nice reason why you are incapable. Look at this crape about being a dull person and not a brilliant wit conversationally - nuts - thats merely an alibi for the times when you just can't quite put out the effort to be yourself. If something doesn't come easily you withdraw into a little shell and then invent some nice fault so that you can indulge in some nice self criticism. \n\n     What always seems to go along with the lack of perseverance but lack of courage as well. So so often [?] this no self-confidence but my positive little friend, you and I both know you really have plenty of that in every way except where it is actually doing something other than just talking, a lack of confidence. We have talked about your hard impersonal shell. It is merely a protective device to cover your lack of courage and perseverance (jointly guts). You hide behind this shell when you haven't the courage to expose your inner self and because you're afraid you may hurt yourself by your inability to really do a job. \n\n     Lack of self confidence, lack of guts, which causes which I don't know, but I do know that its only the courage and perseverance which will give you faith in yourself. You are your wont worst critic and most ineffective. You do the criticizing so that on one else will and thus you can deflect the fire to something less tender within you. It won't work! \n\n     You've got to try and try now because the older you get the harder it will be. What do you want in life, a husband, home & family but look at yourself; by your own admission a lousy risk. And essentially why? Coldness, no; selfishness, not really; but just a complacent lack of effort, and a withdrawal into yourself at the slightest fear of being hurt. We both know why that would make a wretched marriage companion. \n\n     All I want to impress on you is the need for Trying; just making an effort. This doesn't have to be any special effort in any particular direction but in everything, work, athletics, your relations with others and particularly your self. Your self discipline exercises and your [mental?] sacrifices were good. But mainly just keep trying. ",afterEntry:null,additionalContent:null},C.y,t.R)
